  \"2016-07-27T22:24:58.262118\",\n\t\"name\": \"community-survey-results-for-rappahannock-river-valley-national-wildlife-refuge-completion\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This report provides a summary of results
  for the survey of residents of communities adjacent to Rappahannock River Valley
  NWR conducted from the spring through the summer in 2006. The purpose of this study
  was to: determine community preferences for wildlife-dependent recreation activities
  and services that could potentially be provided by the Refuge in the future; determine
  community knowledge and understanding of Rappahannock NWRu2019s purpose, the mission
  of the National Wildlife Refuge System, and land-acquisition issues; gain a broader
  understanding of community recreation use of the Rappahannock River; provide insight
  into community communication and interaction regarding river issues; and determine
  community preferences for land management on the Refuge.\",\n\t\"license_title\":
